settings.graphqlSchema:
schema {
	query: Query
	mutation: Mutation
}
type Query {
	getBankAccounts(bank: String): [AccountKV]
	getIOUHistory(id: String): [IOUHistory]
	getAccountTransactions(name: String, bank: String): [TransactionKV]
	queryIOUByAmount(issuer: String, owner: String, amount: Float): [IOUKV]
	getIOUByIssuer(issuer: String): [IOUKV]
	getIOUByOwner(owner: String): [IOUKV]
}
type Mutation {
	transfer(owner: String, id: String, newOwner: String): IOU
	buy(bank: String, owner: String, iou: String): IOU
	createAccount(name: String, bank: String, balance: Float): Account
	issue(bank: String, owner: String, amount: Float): IOU
	redeem(owner: String, bank: String, id: String): Account
	send(senderBank: String, sender: String, receiverBank: String, receiver: String, amount: Float): IOU
	exchange(owner: String, bank: String, id: String): IOU
}
type IOUHistory {
	txID: String
	txTime: String
	isDeleted: Boolean
	value: IOU
}

type IOUKV {
	key: String
	value: IOU
}

type Account {
	name: String
	bank: String
	balance: Float
	currency: String
}

type Transaction {
	account: String
	amount: Float
	iouRef: String
	txID: String
	txTime: String
}

type IOU {
	amount: Float
	currency: String
	issueDate: String
	owner: String
	id: String
	issuer: String
}

type AccountKV {
	key: String
	value: Account
}

type TransactionKV {
	key: String
	value: Transaction
}
